import React from "react";
import Navbar from "../components/Navbar";

function Development() {
  return (
    <div>
      <Navbar />
      <div className="const-div">
        <h1>This page is under development</h1>
        <p>
          This is a demo page, to explore more of the main page, please click
          the button below or click on the Title in the top right corner.
        </p>
        <button className="front-btn">HOME</button>
      </div>
    </div>
  );
}

export default Development;
